def generate_url(bucket, file_key, endpoint=None, expiration=None):
    if endpoint:
        return f'{endpoint}{bucket}/{file_key}?expires={expiration}'
    else:
        return f'https://{bucket}.storage.com/{file_key}?expires={expiration}'

